import React from "react";

function Logo() {
  return (
    <Navbar.Brand href="#home">
      <img
        src="logo-placeholder.png" // Replace with actual logo path
        alt="Salada Logo"
        className="logo"
      />
    </Navbar.Brand>
  );
}

export default Logo;
